import "./styles/App.scss";
import UIButton from "./components/layout/buttons/uibutton/button";
import Upvote from "./components/layout/buttons/upvote-btn/upvote";
import { createTheme, ThemeProvider } from "@material-ui/core";

const theme = createTheme({
  // styles goes here
});

function App() {
  return (
    <>
      <ThemeProvider>
        <UIButton
          type="button"
          buttonStyle="btn-primary-solid"
          buttonSize="btn-normal"
        >
          +Add Feedback
        </UIButton>
        <UIButton
          type="button"
          buttonStyle="btn-icon-solid"
          buttonSize="btn-normal"
        >
          Go Back
        </UIButton>
        <Upvote type="button" buttonStyle="btn-upvote-solid"></Upvote>
      </ThemeProvider>
    </>
  );
}

export default App;
